import logo from './logo.svg';
import './App.css';
import RecipeForm from './RecipeForm';
import IngredientForm from './IngredientForm';

function WelcomePage() {
  return (
    <div>
      <h1>Create a new recipe</h1>
      <RecipeForm />
    </div>
  );
}

function App() {
  return (
    <Router>
      <div className='App'>
        <Switch>
          <Route exact path="/">
            <RecipeForm />  
          </Route>
          <Route path="/ingredients">
            <IngredientForm />  
          </Route>  
        </Switch>
      </div>
    </Router>
  );
}

export default App;
